import React from 'react';

import './Board.css';
import {Cell} from '../cell/Cell';

export const Board = () => {
	const cellValues =['X','X','X','X','X','O','O','O','O'];
	const cells =cellValues.map((value, index) => 
	<Cell value={value} canHighlight ={false}/>
	);
  return (<>
      	<div id="board">
			{cells}
      	</div>
  </>
  );
}
